import React, { useEffect, useState } from 'react'
import api from '../../services/api'
import { useResultadoContext } from '../../context/Resultados';
import Botao from '../../components/Botao';
import TelaErro from '../../components/TelaErro';
import Cabecalho from '../../components/Cabecalho';
import styles from './Home.module.css'

export default function Home() {
    const { resultado } = useResultadoContext();
    const [user, setUser] = useState();

    useEffect(() => {
        api
            .get(resultado)
            .then((response) => setUser(response.data))
            .catch((err) => {
                console.error("ops! ocorreu um erro" + err);
            });
    });

    if (!user?.cpf) {
        return (
            <TelaErro />
        )
    } else {
        return (
            <>
                <Cabecalho perfil={user?.perfil} />
                <div className={styles.container}>
                    <h1>Olá {user?.apelido},</h1>
                    <p></p>
                    <h3>Seja bem-vindo(a) ao nosso sistema!</h3>
                    <h3>Escolha o que deseja fazer agora:</h3>
                    <p>CPF: {user?.cpf}</p>
                    <Botao url='/'>Voltar</Botao>
                    <Botao url='/'>Dados Pessoais</Botao>
                </div>
            </>
        )
    }

}
